import React from "react";
import { getalldata } from "./Feature/slice";
import { useSelector, useDispatch } from "react-redux";

function App1() {
  const dispatch = useDispatch();
  const data = useSelector((state) => {
    return state.app;
  });
  return (
    <div>
      <h1>welcome</h1>
      <button onClick={() => dispatch(getalldata())}>Submit</button>
      {data.users.map((user) => (
        <div>{user.name}</div>
      ))}
    </div>
  );
}

export default App1;
